        public static string hwp_hnchar_to_utf8(ushort c)
        {
            StringBuilder @string = new StringBuilder();
            if (c >= 0x0020 && c <= 0x007e)
            {
                /* ASCII printable characters */
                @string.Append((char)c);
            }
            else if (c >= 0x007f && c <= 0x3fff)
            {
                /* ASCII printable characters */
                @string.Append((char)hnc2uni_page0[c]);
            }
            else if (c >= 0x4000 && c <= 0x5317)
            {
                /* 1수준 한자 4888자 */
                @string.Append((char)hnc2uni_page4[c - 0x4000]);
            }
            else if (c >= 0x5318 && c <= 0x7fff)
            {
                /* 2수준 한자 */
                @string.Append((char)hnc2uni_page5[c - 0x5318]);
            }
            else if (c >= 0x8000 && c <= 0xffff)
            {
                int index = c - 0x8000;
                /* 한글 영역 */
                for (int i = 0; i < 3; i++)
                {
                    if (hnc2uni_page8[index, i] == 0)
                        break;
                    @string.Append((char)hnc2uni_page8[index, i]);
                }
            }
            else
            {
                Trace.TraceWarning("{0:X4}: out of hnc code range", c);
            }
            return @string.ToString();
        }

        public static string hwp_hychar_to_utf8(ushort c)
        {
            StringBuilder @string = new StringBuilder();
            if (c >= 0xe0bc && c <= 0xf8f7)
            {
                /* 한양PUA 코드 */
                int index = c - 0xe0bc;
                for (int i = 0; i < 3; i++)
                {
                    if (hyc2uni_page14[index, i] == 0)
                        break;
                    @string.Append((char)hyc2uni_page14[index, i]);
                }
            }
            else
            {
                Trace.TraceWarning("{0:X4}: out of hypua code range", c);
            }
            return @string.ToString();
        }

